// Helper to get all projects flat list if needed
export const getAllProjects = (): Project[] => {
  const allProjects: Project[] = [];
  projectCategories.forEach(cat => {
    cat.sections.forEach(sec => {
      allProjects.push(...sec.projects);
    });
  });
  return allProjects;
};
